import React, { useState, useEffect } from "react";
import {Link} from 'react-router-dom'

function Block() {
  
    const [profile, SetProfile] = useState('');
  
    useEffect(async() => {
  
      let response = await fetch('https://jsonplaceholder.typicode.com/users');
  
      let text = await response.json();
  
      SetProfile(text.map(information => 
        <div key={information.id} className="block">
            <h3>FIO: {information.name}</h3>
            <h3>City: {information.address.city}</h3>
            <h3>Company: {information.company.name}</h3> 
            <nav><Link to='/Profile' name={information.id}>More</Link></nav>
        </div>
      ));
    });

  return (
    <div className="Block">
        {profile}
    </div>
  );
}

export default Block;
